<h1 id="adobe-cc-libraries-apis">Adobe CC Libraries APIs v0.1</h1>

> Scroll down for code samples, example requests and responses. Select a language for code samples from the tabs above or the mobile navigation menu.

Base URLs:

* <a href="https://cc-libraries.adobe.io/">https://cc-libraries.adobe.io/</a>

<h1 id="adobe-cc-libraries-apis-library-service">Library Service</h1>

App-facing APIs for Adobe CC Libraries.

## getLibraries

<a id="opIdgetLibraries"></a>

`GET /api/v1/libraries`

*Retrieve libraries for a user*

<h3 id="getlibraries-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|orderBy|query|string|false|Sorting option for the response list. |
|start|query|string|false|The first result to include for a paged response, 0-based. |
|limit|query|string|false|The number of libraries to return for a paged response. |
|owner|query|string|false|Customize which libraries to include in the response, based on ownership. |
|selector|query|string|false|Customize which data sets to include in the response. |
|toolkit|query|string|false|Customize which toolkit libraries to include in the response. |
|authorization|header|string|true|An access token issued by Adobe IMS. In the header, the access token must be preceded by `Bearer `.|
|x-api-key|header|string|true|The API key assigned to your API client account when you signed up.|
|x-request-id|header|string|false|A unique request identifier that you define. Used by Adobe Support to trace the request in logs. This header is automatically generated by the server and returned in the response if you do not set it explicitly.|

#### Detailed descriptions

**orderBy**: Sorting option for the response list. 
Reverse sort is enabled with a - character ahead of the sorting vector. (ex: -modified_date) 
Multi-vector sort is enabled by including multiple vectors separated by commas. (ex: name,-modified_date) 
Sorting is not available for public libraries. 

**Possible Values** 
- `name`: Sort by the name.
- `modified_date`: Sort by the last modified date.

**start**: The first result to include for a paged response, 0-based. 
This parameter is required if a limit is specified. 
Paging is not available for public libraries.

**limit**: The number of libraries to return for a paged response. 
Paging is not available for public libraries. 

**Possible Values** 
- Min: 1. 
- Max: 10.

**owner**: Customize which libraries to include in the response, based on ownership. 

**Possible Values** 
- `private`: Libraries owned by the user. 
- `incoming`: Libraries shared with the user. 
- `outgoing`: Libraries the user has shared with others. 
- `public`: Libraries the user has followed. 
- `all`: All of the above except public.

**selector**: Customize which data sets to include in the response. 
All applications using this API will need the same sets of data, but different applications will not require different depths of details. 
Callers can specify a comma-separated list of selectors to either limit or expand the default response. The absence of selectors will yield the default response, while including selectors gives callers access to building-blocks to compose the response to their needs. 

**Possible Values** 
- `default`: Base data, use this to build out custom response. 
- `details`: All available data for in-depth display. 
- `collaboration`: Add collaboration data to a lesser-scoped selector. 
- `groups`: Include group data in the response. 
- `rendition_grid`: Provides a set of links to library element image renditions, which can be combined to create a thumbnail for the library. The `main` rendition link is the first asset uploaded to the library, while the `tiles` contain the three most recently updated library elements' rendition links. 

**toolkit**: Customize which toolkit libraries to include in the response. 

**Possible Values**- `all`: Include all toolkit libraries. 
- `none`: Do not include any toolkit libraries. 
- `<toolkit-id>`: Include libraries matching a specific toolkit-id, or comma-separated list of toolkit-ids.

