## postLibraryElements

<a id="opIdpostLibraryElements"></a>

`POST /api/v1/libraries/{libraryId}/elements`

*Create, copy, or move elements*

Create a new element, or copy/move existing elements. 

**Create Element** 
Create a single element. All elements require at least one asset-based or literal representation. 
When creating a new asset-based element (ex: images, thumbnails, video), upload the asset(s) BEFORE creating the element. 
Use the response(s) from the Upload Asset API call(s) as objects in the `representations` array when using this API to create a new element. 

**Move Elements** 
Move one or more elements, which means delete it from its current location and create it in the target library (indicated by this API's `libraryId` path param). 
To move an element, use the `self` object in the request body of this API call. 
- `elements`: Array of element(s) to move, specified by Element ID. 
- `id`: The library where the element(s) currently exist, specified by Library URN. 

**Copy Elements** 
Copy one or more elements, which means leave the original element untouched and create a copy of it in the target library (indicated by this API's `libraryId` path param). 
To copy an element, use the `source` object in the request body of this API call. 
- `elements`: Array of element(s) to move, specified by Element ID. 
- `id`: The library where the element(s) currently exist, specified by Library URN. If the source Library ID is the same as the target library, the element(s) will be duplicated.

