|Name|In|Type|Required|Description|
|---|---|---|---|---|
|libraryId|path|string|true|The ID of the requested library. |
|elementId|path|string|true|The ID of the requested element.|
|invocation_mode|path|string|true|Specifies the processing mode to invoke this request process with. |
|authorization|header|string|true|An access token issued by Adobe IMS. In the header, the access token must be preceded by `Bearer `.|
|x-api-key|header|string|true|The API key assigned to your API client account when you signed up.|
|x-request-id|header|string|false|A unique request identifier that you define. Used by Adobe Support to trace the request in logs. This header is automatically generated by the server and returned in the response if you do not set it explicitly.|
|body|body|[PostLibraryElementsPayload](#schemapostlibraryelementspayload)|false|none|

#### Detailed descriptions

**libraryId**: The ID of the requested library. 
For private libraries, the `library_urn` should be used. (ex: urn:aaid:sc:US:1c2327c6-ca3a-8f74-11ac-d5bca13a8fc7) 
For public libraries, the public library `id` should be used. (ex: 1UTOX1PQ9YWOTFIPUEQUV0Z2XFTFFF)

**invocation_mode**: Specifies the processing mode to invoke this request process with. 

**Possible Values** 
- `sync`: API call is processed synchronously. The response is delivered when processing is complete, unless there's a timeout. 
- `async`: The async monitor response is immediately returned and request processing occurs asynchronously. The caller is responsible for polling that endpoint until completion. 
- `sync,async`: (Default) Synchronous processing of the request is attempted. When the processing extends past 5000ms, the async monitor response is returned. The monitor URL should be polled until the request is complete.

