<h1 id="adobe-cc-libraries-apis-library-service-bookmarks">Library Service - Bookmarks</h1>

App-facing APIs specifically for Adobe CC Library Bookmarks.

## getBookmarks

<a id="opIdgetBookmarks"></a>

`GET /api/v1/libraries/bookmarks`

*Retrieves all bookmarks for a user*

<h3 id="getbookmarks-parameters">Parameters</h3>

|Name|In|Type|Required|Description|
|---|---|---|---|---|
|authorization|header|string|true|An access token issued by Adobe IMS. In the header, the access token must be preceded by `Bearer `.|
|x-api-key|header|string|true|The API key assigned to your API client account when you signed up.|
|x-request-id|header|string|false|A unique request identifier that you define. Used by Adobe Support to trace the request in logs. This header is automatically generated by the server and returned in the response if you do not set it explicitly.|

