|asset_type|[string]|false|none|`library` and/or `element`. Leaving this out of the request will get both by default, though element-only parameters like `library_id` or `archived` will isolate the result to elements.|
|library_id|string|false|none|Library ID (URN) to constrain an elements search to a single library (like "urn:aaid:sc:us:2f3268e9-039d-460f-8b07-8854f7677645"). Invalid if submitted with `"asset_type": ["library"]`.|
|group|string|false|none|Isolate element results to a single group. Invalid if submitted with `"asset_type": ["library"]`.|
|name|string|false|none|A name string to identify by library/asset name. Requires an exact match.|
|query_string|string|false|none|A general query string to search for libraries/assets. Includes partial matches.|
|created_date|[string]|false|none|Start & end dates in epoch time (ms since epoch).|
|modified_date|[string]|false|none|Start & end dates in epoch time (ms since epoch).|
|type|[string]|false|none|One or more types for elements, invalid if submitted with `"asset_type": ["library"]`.|
|archived|boolean|false|none|Search specifically for archived elements (boolean `true`/`false` to isolate results to archived or non-archived). Invalid if submitted with `"asset_type": ["library"]`.|
|orderBy|string|false|none|defaults to `-modified_date`, also accepts `name`. Use a minus sign prefix to note descending.|
|start|string|false|none|String value. For libraries lists, the requirement to integrate bookmarked responses requires us to use the field in a clever fashion beyond a simple positive integer.|
|limit|integer(int32)|false|none|Positive integer, defines the number of results to return for a paged response. Defaults to `10`. Max limit for library searches is `10`, max limit for element searches is `100`.|
|owner|string|false|none|`private` (default), `incoming`, `outgoing`, `public`, or `all`. `all` does not include `public` until bookmarks are integrated into the USS search results.|
|selector|string|false|none|Customize response for larger/smaller data sets. (`default` [base response], `rendition_grid`, `collaboration`, `details`, `full`).|
|has_stock_content|boolean|false|none|Search for libraries that have stock content, or elements within a library that have stock content (boolean `true`/`false` to isolate results to stock content or all content).|
|stock_content_id|string|false|none|Search for elements with a specific Stock Content ID. Invalid if submitted with `"asset_type": ["library"]` or `"has_stock_content": false`.|

